var title_f41_38_42604="Features of secondary HTN";
var content_f41_38_42604=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F56130&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F56130&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical features of the different causes of secondary hypertension",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Disorder",
"       </td>",
"       <td class=\"subtitle1\">",
"        Suggestive clinical features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"4\">",
"        General",
"       </td>",
"       <td>",
"        Severe or resistant hypertension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        An acute rise in blood pressure over a previously stable value",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Proven age of onset before puberty",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Age less than 30 years with no family history of hypertension and no obesity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"5\">",
"        Renovascular disease",
"       </td>",
"       <td>",
"        An acute elevation in serum creatinine of at least 30 percent after administration of angiotensin-converting enzyme (ACE) inhibitor or angiotensin II receptor blocker (ARB)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Moderate to severe hypertension in a patient with diffuse atherosclerosis, a unilateral small kidney, or asymmetry in renal size of more than 1.5 cm that cannot be explained by another reason",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Moderate to severe hypertension in patients with recurrent episodes of flash pulmonary edema",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Onset of stage II hypertension after age 55 years",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Systolic or diastolic abdominal bruit (not very sensitive)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Primary renal disease",
"       </td>",
"       <td>",
"        Elevated serum creatinine concentration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Abnormal urinalysis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Oral contraceptives",
"       </td>",
"       <td>",
"        New elevation in blood pressure temporally related to use",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Pheochromocytoma",
"       </td>",
"       <td>",
"        Paroxysmal elevations in blood pressure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Triad of headache (usually pounding), palpitations, and sweating",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Primary aldosteronism",
"       </td>",
"       <td>",
"        Unexplained hypokalemia with urinary potassium wasting; however, more than one-half of patients are normokalemic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Cushing's syndrome",
"       </td>",
"       <td>",
"        Cushingoid facies, central obesity, proximal muscle weakness, and ecchymoses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        May have a history of glucocorticoid use",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Sleep apnea syndrome",
"       </td>",
"       <td>",
"        Primarily seen in obese men who snore loudly while asleep",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Daytime somnolence, fatigue, and morning confusion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Coarctation of the aorta",
"       </td>",
"       <td>",
"        Hypertension in the arms with diminished or delayed femoral pulses and low or unobtainable blood pressures in the legs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Left brachial pulse is diminished and equal to the femoral pulse if origin of the left subclavian artery is distal to the coarct",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Hypothyroidism",
"       </td>",
"       <td>",
"        Symptoms of hypothyroidism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Elevated serum thyroid stimulating hormone",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Primary hyperparathyroidism",
"       </td>",
"       <td>",
"        Elevated serum calcium",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
